My Sisters Hot Friend - Esmi Lee,

Actors: Esmi Lee, Cris Commando

Release Date: October 29, 2010

Who: Girlfriend,

Where: Chair, Public Place,

Chris is studying hard for his exam when his sister's ex-friend and now girlfriend, Esmi Lee, sneaks up behind him and begins giving him a hard time about going to the beach. There's no way Esmi can get him to come out with her so she decides they'll have some fun right in the library! She'll let him hit the books after he taps that ass.
